void wait_for_sync() {
    int status;
    *pixel_ctrl_ptr = 1;
    
    status = *(pixel_ctrl_ptr + 3);
    while((status & 0x1) != 0) {
        status = *(pixel_ctrl_ptr + 3);
    }
}

void draw_line(int start_x, int start_y, int end_x, int end_y, short int color) {
    int dx = end_x - start_x;
    int dy = end_y - start_y;
    int is_steep = (ABS(dy) > ABS(dx))?TRUE:FALSE;
    
    if (is_steep) {
        int temp = start_x;
        start_x = start_y;
        start_y = temp;
        temp = end_x;
        end_x = end_y;
        end_y = temp;
    }
    if (start_x > end_x){
        int temp = start_x;
        start_x = end_x;
        end_x = temp;
        temp = start_y;
        start_y = end_y;
        end_y = temp;
    }
    dx = end_x - start_x;
    dy = ABS(end_y - start_y);
    
    int error = -dx / 2;
    
    int y_dir = (start_y < end_y)?1:-1;
    
    for ( ; start_x <= end_x; ++start_x) {
        if (is_steep) {
            plot_pixel( start_y, start_x, color);
        }
        else {
            plot_pixel( start_x, start_y, color);
        }
        error += dy;
        if(error >= 0){
            start_y += y_dir;
            error -= dx;
        }
    }
}

